import React, { Component } from 'react';



class Contact extends Component{

    render(){

        return(
            <section className="py-5 contact-section" id={'Contact-Section'}>
                <div className=" py-3 container">
                    <h3 className='heading'>
                                Contact
                    </h3>
                    <div className=' row contact-grids'>
                        <div className=" col-lg-5 contact-letf">
                            <h4 className='mb-4'> Address Info</h4>
                            <div className='row'>
                                <di className='col-1 pr-0 mt-4'>
                                    <i className="fa fa"></i>
                                </di>

                            </div>
                        </div>

                        <di className='col-lg-7 mt-lg-0 mt-5 contact-rigth'>

                        </di>
                    </div>
                </div>

            </section>
        )
    }
}

// SHA256:0VvCKlZXUykgVZdZ0Wk51EFubCmoHgz7rwAkRdQ97b4


export default Contact;
